import EventCard from "./EventCard";

function Events(){
    const [events, setEvents] = useState([]);

    return(
        <div className="event-list">
      {events.map(event => (
        <EventCard key={event._id} event={event} onViewDetails={handleViewDetails} />
      ))}
    </div>
    )
}

export default Events;
